import './Header.css';
import logo from './solana-sol-logo.svg';
import menu from './hamburger.svg';

function Header() {
  return (
    <div className="Header">
        <img src={logo} className="Sol-logo" height="300" width="300" alt="logo" />
        <img src={menu} className="hamburger" alt="menu" />
    </div>
  );
}

export default Header;
